import {
    SET_BOARD_FILLED 
} from "../actions/types";

const initialState = {
    selectedModules: false
}

export default function (state = initialState, action) {
    switch (action.type) {
        case SET_BOARD_FILLED: 
            return {
                ...state,
                selectedModules: true
            }
    }
}
